	(10,1,'5d88a531-7ac9-e5d0-c127-e7fb84fd9288',5,2,3,0,0,'VID-20151221-WA0000.mp4','bbe3121a-16dd-45f1-f9d8-7e0dfc52f9e9','mp4',171,'00:02:50.71','Desde el M√≥vil','Jorge Rubiano','camila_marin1984@hotmail.com','Para ver que pasa','2016-08-31 21:08:19','31/08/2016','09:08:19 pm',1472695699,'2016-08-31 21:18:07','31/08/2016',1472696287,NULL,NULL,NULL),
	(11,1,'76566087-8490-706e-87bc-d9b6758bbf9f',5,2,3,0,0,'VID-20151230-WA0000.mp4','4b0608e4-3e9c-917a-efa5-3eeb8ce80cff','mp4',56,'00:00:56.30','Desde el M√≥vil','Jorge Rubiano','camila_marin1984@hotmail.com','Pues','2016-08-31 21:08:19','31/08/2016','09:08:19 pm',1472695699,'2016-08-31 21:18:17','31/08/2016',1472696297,NULL,NULL,NULL),
	(12,1,'0bc7b4b5-2703-c701-d329-285d000ee51f',5,2,3,0,0,'VID-20160509-WA0000.mp4','846a0550-4cce-55fa-628d-fe3d0752d72e','mp4',185,'00:03:04.70','Un nuevo video','Juan Gabriel','ostricajh@gmail.com','Ya queda el texto','2016-08-31 21:44:47','31/08/2016','09:44:47 pm',1472697887,'2016-08-31 22:02:43','31/08/2016',1472698963,NULL,NULL,NULL),
	(13,1,'756391e7-fb8d-ccb9-d2b2-6cce4e7b78c9',5,2,3,0,0,'videoSudoku.mov','18851a5d-c8b5-c306-a7cb-d0e174d737d9','mov',18,'00:00:18.22','V√≠deo con mucho texto','Carlos Mar√≠n','carlos@correo.com','<p name=\"fbda\" id=\"fbda\" class=\"graf--p graf-after--pullquote\" style=\"margin-bottom: 0px; font-family: medium-content-serif-font, Georgia, Cambria, &quot;Times New Roman&quot;, Times, serif; font-size: 21px; line-height: 1.58; letter-spacing: -0.003em; color: rgba(0, 0, 0, 0.8);\">I know that sounds kinda cool in a B-movie sci-fi kinda way, but believe me, time-traveling spaghetti is the worst tasting kind there is!</p><p name=\"de7e\" id=\"de7e\" class=\"graf--p graf-after--p\" style=\"margin-top: 29px; margin-bottom: 0px; font-family: medium-content-serif-font, Georgia, Cambria, &quot;Times New Roman&quot;, Times, serif; font-size: 21px; line-height: 1.58; letter-spacing: -0.003em; color: rgba(0, 0, 0, 0.8);\">What the flux architecture does is enforce a strict separation and sequence, which obeys these rules every time:</p><ol class=\"postList\" style=\"margin: 29px 0px 0px; padding: 0px; list-style: none none; counter-reset: post 0; color: rgba(0, 0, 0, 0.8); font-family: -apple-system, BlinkMacSystemFont, &quot;Segoe UI&quot;, Roboto, Oxygen, Ubuntu, Cantarell, &quot;Open Sans&quot;, &quot;Helvetica Neue&quot;, sans-serif; font-size: 18px; line-height: 25.2px;\"><li name=\"fc80\" id=\"fc80\" class=\"graf--li graf-after--p\" style=\"margin-left: 30px; margin-bottom: 14px; font-family: medium-content-serif-font, Georgia, Cambria, &quot;Times New Roman&quot;, Times, serif; font-size: 21px; line-height: 1.58; letter-spacing: -0.003em;\">First, we get into a known, fixed state‚Ä¶</li><li name=\"a883\" id=\"a883\" class=\"graf--li graf-after--li\" style=\"margin-left: 30px; margin-bottom: 14px; font-family: medium-content-serif-font, Georgia, Cambria, &quot;Times New Roman&quot;, Times, serif; font-size: 21px; line-height: 1.58; letter-spacing: -0.003em;\">Then we render the view. Nothing can change the state again for this render loop.</li><li name=\"296e\" id=\"296e\" class=\"graf--li graf-after--li\" style=\"margin-left: 30px; margin-bottom: 14px; font-family: medium-content-serif-font, Georgia, Cambria, &quot;Times New Roman&quot;, Times, serif; font-size: 21px; line-height: 1.58; letter-spacing: -0.003em;\">Given the same state, the view will always render the same way.</li><li name=\"e522\" id=\"e522\" class=\"graf--li graf-after--li\" style=\"margin-left: 30px; margin-bottom: 14px; font-family: medium-content-serif-font, Georgia, Cambria, &quot;Times New Roman&quot;, Times, serif; font-size: 21px; line-height: 1.58; letter-spacing: -0.003em;\">Event listeners listen for user input and network request handlers. When they get them, actions are dispatched to the store.</li><li name=\"30ea\" id=\"30ea\" class=\"graf--li graf-after--li\" style=\"margin-left: 30px; margin-bottom: 0px; font-family: medium-content-serif-font, Georgia, Cambria, &quot;Times New Roman&quot;, Times, serif; font-size: 21px; line-height: 1.58; letter-spacing: -0.003em;\">When an action is dispatched, the state is updated to a new known state and the sequence repeats. Only dispatched actions can touch the state.</li></ol><p name=\"1fdd\" id=\"1fdd\" class=\"graf--p graf-after--li\" style=\"margin-top: 29px; margin-bottom: 0px; font-family: medium-content-serif-font, Georgia, Cambria, &quot;Times New Roman&quot;, Times, serif; font-size: 21px; line-height: 1.58; letter-spacing: -0.003em; color: rgba(0, 0, 0, 0.8);\">That‚Äôs Flux in a nutshell: A one-way data flow architecture for your UI:</p><p name=\"1fdd\" id=\"1fdd\" class=\"graf--p graf-after--li\" style=\"text-align: center; margin-top: 29px; margin-bottom: 0px; font-family: medium-content-serif-font, Georgia, Cambria, &quot;Times New Roman&quot;, Times, serif; font-size: 21px; line-height: 1.58; letter-spacing: -0.003em; color: rgba(0, 0, 0, 0.8);\"><img src=\"data:image/png;base64,\" data-filename=\"Captura de pantalla 2016-04-17 a las 7.36.14 p.m..png\" style=\"width: 294px;\"><br></p>','2016-08-31 22:12:42','31/08/2016','10:12:42 pm',1472699562,'2016-08-31 22:15:10','31/08/2016',1472699710,NULL,NULL,NULL),
